8IKOzPrdWL8.description:
Ingredientes:
- 500g de Feijão Preto Urbano;
- 2 litros de água;
- 60g de bacon;
- 150g de paio;
- 4 fatias de linguiça calabresa;
- 2 colheres (sopa) de azeite;
- 1 cebola picada;
- 2 dentes de alho;
- 2 colheres (sopa) de cebolinha picada;
- Sal e molho de pimenta a gosto;

Modo de preparo:
- Adicione o Feijão Preto Urbano na panela de pressão junto com a água, adicione sal a gosto.
- Cozinhe por 30 minutos ou até os grãos ficarem bem macios, reserve.
- Em uma panela média, doure no azeite, o paio, o bacon e a linguiça calabresa. Acrescente o alho e a cebola e refogue um pouco.
- Acrescente o feijão cozido.
- Deixe no fogo médio por 10 minutos.
- No liquidificador, coloque o feijão cozido e bata até ficar cremoso.
- Acrescente a cebolinha.
- Se preferir, sirva com o molho de pimenta.

