HQUckSu3AUw.description:
Concurseiro de carteirinha, o funcionário público William Bosich de Souza, 26 anos coleciona aprovações e primeiros lugares em concursos públicos. Morador de Juiz de Fora, em Minas Gerais, ele se prepara há oito anos para provas que exigem o ensino médio.
William já conquistou os primeiros lugares dos concursos do Instituto Nacional do Seguro Social(INSS),  Tribunal de Justiça de Minas Gerais (TJ-MG) e do Banco do Brasil. 
Apesar dos ótimos resultados obtidos, o concurseiro não se considera disciplinado, diz estudar apenas três horas por dia e folga sempre aos domingos e feriados. “Quando estudo eu me dedico totalmente a isso e respeito o meu limite”, diz.
A primeira aprovação de William veio no concurso para técnico bancário novo da Caixa Econômica Federal, em 2006. “Não consegui uma boa colocação e isso me serviu de motivação para continuar estudando. Percebi depois do primeiro concurso que fiz que só dependia de mim para ser aprovado ”, conta.
Veja a dica que este campeão dá para quem está se preparando!
- Se perder a concentração, mude de atividade, mas não pare de estudar;
- Na véspera da prova, não estude, faça refeições leves e relaxe a mente. Procure estar sereno e tranquilo. “O dia da prova é o momento de você mostrar tudo o que aprendeu”, comenta;
- Na prova, procure fazer primeiro as questões das disciplinas específicas, deixe as dúvidas para depois. Esgote as provas de cada uma das disciplinas, uma a uma e deixe o gabarito por ; 
- Encare a carreira pública como um conforto, tanto da parte financeira como pela estabilidade;
- Mesmo após de aprovado, não pare de estudar, pois a nomeação nem sempre é certa;
- Passar em concurso público não é um mito. A sua aprovação só depende de  você.

