H16V1CVf1FI.description:
Kuat One Tandem - new generation to live up

O Kuat One é um projeto completamente novo, mais fácil de voar, com design inovador, e ganho significativo em performance.

Um parapente versátil que inspira confiança, permitindo ao piloto e passageiro aproveitarem o voo, conferindo o puro prazer de voar.

É direcionado tanto para pilotos profissionais de voo duplo, como também para pilotos que desejam fazer longos voos de distância e térmicas, e até para pilotos ocasionais que voam com seus amigos e familiares.

O Kuat One é um parapente de duplo classe LTF/EN B e requer a experiência de pilotos habilitados para este fim.

É oferecido em dois tamanhos, facilitando voar dentro da faixa ideal de uso.

A eficiência e a precisão do conjunto são similares a de um moderno parapente da classe B. Sua manobrabilidade permite voar as menores térmicas.
É o excelente compromisso entre facilidade de uso e desempenho em mais um produto que a SOL Paragliders oferece para o mercado.

Novidades no Kuat em relação ao antecessor:

- Mais fácil de operar - decolagem / pilotagem / pouso;
- 5 células a mais - construção mais precisa;
- Vela mais compacta na relação alongamento real x projetado;
- 3 tirantes e consumo de linhas 15% menor;
- Reforço em Talas ;
- Maior velocidade e ganho aprox. 1,0 de planeio.


KUAT One Tandem -  new generation to live up

The KUAT One is a completely new project, easy to fly with a simple handling, a notable performance gain and an innovative design.

This glider is directed to professional tandem pilots as for licensed leisure pilots, too, who fly for fun with friends and family, enjoying  the pure pleasure of flying.

Offered  in  two sizes,  the KUAT One  is a LTF/EN B Tandem-class wing and requires the experience of qualified pilots for this purpose.

It´s efficiency and accuracy are similar to a modern B class glider, offering highest performance in even small thermals.

The perfect balance between easy handling and great performance.


KUAT One  Features:

- Easy handling at take-off / piloting / landing;
- More precise and more compact construction with 5 cells more;
- More compact AR real x projected;
- 3 risers and 15% less lines;
- BT - Battens Technology;
- Increased speed and glide gain of 1.0

